const Semster = () => {
    const navigate = useNavigate();
    return (
        <div className="bg-gray-200 p-6 cursor-pointer">
            sdfhesdjf
            <h1
                onClick={() => {
                    navigate('economy');
                }}
            >
                Economy
            </h1>
            <h1
                onClick={() => {
                    navigate('maths');
                }}
            >
                Maths
            </h1>
            <h1
                onClick={() => {
                    navigate('english');
                }}
            >
                English
            </h1>
        </div>
    );
};

export default Semster;
